sub dialytikavaria by dialytikavaria.case;
sub dialytikaoxia by dialytikaoxia.case;
sub dialytikaperispomeni by dialytikaperispomeni.case;
sub varia by varia.case;
sub oxia by oxia.case;
sub perispomeni by perispomeni.case;
sub psilivaria by psilivaria.case;
sub acutecomb by acutecomb.case;
sub circumflexcomb by circumflexcomb.case;
sub circumflexcomb_gravecomb by circumflexcomb_gravecomb.case;
sub circumflexcomb_acutecomb by circumflexcomb_acutecomb.case;
sub circumflexcomb_tildecomb by circumflexcomb_tildecomb.case;
