sub caroncomb by caroncomb.case;

} case;

feature liga {
# automatic
lookupflag IgnoreMarks;
sub f f i by f_f_i;
sub f f l by f_f_l;
sub f f by f_f;
sub f i by fi;
sub f l by fl;

} liga;

feature salt {
# automatic
sub franc by franc.salt;

} salt;

feature ss01 {
featureNames {
  name "Name:";
};
# automatic
sub a by a.ss01;

} ss01;

feature dlig {
sub f f l by f_f_l;
sub f f i by f_f_i;
} dlig;

feature calt {
sub @Uppercase germandbls' @Uppercase by germandbls.calt;
sub @Uppercase @Uppercase germandbls' by germandbls.calt;
} calt;

feature zero {
# automatic
